    function saveNewSchool() {
      const actualYear = year;

      // reset validity messages
      isAllValid = true;
      invalidMessages = [];

      const sanitise = (str) => {
        return str.replace(/'/g, "''").replace(/`/g, "``").trim();
      };

      const row = $("#input-row");
      const newInputs = row.find("input").toArray(); // returns array of input elements inside of the row
      const newTextareas = row.find("textarea").toArray(); // returns array of textarea elements inside of the row
      const newSchoolName = $(newInputs[0]).val()
        ? sanitise($(newInputs[0]).val())
        : "";
      const newRoom = $(newInputs[1]).val()
        ? sanitise($(newInputs[1]).val())
        : ""; // Default to NULL if not found
      const newPhone = $(newInputs[2]).val()
        ? sanitise($(newInputs[2]).val())
        : "";
      const newHomepage = $(newInputs[3]).val()
        ? sanitise($(newInputs[3]).val())
        : "";
      const newHodFirst = $(newInputs[4]).val()
        ? sanitise($(newInputs[4]).val())
        : "";
      const newHodLast = $(newInputs[5]).val()
        ? sanitise($(newInputs[5]).val())
        : "";
      const newHodPhone = $(newInputs[6]).val()
        ? sanitise($(newInputs[6]).val())
        : "";
      const newHodMobile = $(newInputs[7]).val()
        ? sanitise($(newInputs[7]).val())
        : "";
      const newHodEmail = $(newInputs[8]).val()
        ? sanitise($(newInputs[8]).val())
        : "";

      const newNotes = $(newTextareas[0]).val()
        ? sanitise($(newTextareas[0]).val())
        : "";
      const newWifi = $(newTextareas[1]).val()
        ? sanitise($(newTextareas[1]).val())
        : "";
      const newPhotocopier = $(newTextareas[2]).val()
        ? sanitise($(newTextareas[2]).val())
        : "";

      console.log("schoolName", newSchoolName);
      console.log("room", newRoom);
      console.log("phone", newPhone);
      console.log("homepage", newHomepage);
      console.log("hodFirst", newHodFirst);
      console.log("hodLast", newHodLast);
      console.log("hodPhone", newHodPhone);
      console.log("hodMobile", newHodMobile);
      console.log("hodEmail", newHodEmail);
      console.log("notes", newNotes);
      console.log("wifi", newWifi);
      console.log("photocopier", newPhotocopier);

      // sanitise inputs
      checkStringValid("School name", newSchoolName, 1, 50); // school name must be entered
      checkStringValid("Room", newRoom, 0, 50);
      checkStringValid("Phone", newPhone, 0, 20);
      checkStringValid("Homepage", newHomepage, 0, 100);
      checkStringValid("HOD first name", newHodFirst, 0, 50);
      checkStringValid("HOD last name", newHodLast, 0, 50);
      checkStringValid("HOD phone", newHodPhone, 0, 20);
      checkStringValid("HOD mobile", newHodMobile, 0, 20);
      checkEmailValid("HOD email", newHodEmail, true); // is nullable
      checkStringValid("Notes", newNotes, 0, 500);
      checkStringValid("Wifi notes", newWifi, 0, 500);
      checkStringValid("Photocopier notes", newPhotocopier, 0, 500);

      if (!isAllValid) {
        $("#invalid-input").css("display", "flex");
        const appendInvalid = $("#append-invalid");
        for (let i = 0; i < invalidMessages.length; i++) {
          appendInvalid.append(
            $(`
              <p>${invalidMessages[i]}</p>
            `)
          );
        }
        return false;
      }

      // Make null values 'NULL' strings for sql queries & wrap in quotes
      const nullify = (val) =>
        val === "" || val === null ? "NULL" : `'${val}'`;

      const insertSchool = `
      INSERT INTO schools_${actualYear} (
      name, 
      room, 
      phone, 
      homepage, 
      notes, 
      wifi, 
      photo_copy_notes
) 
      VALUES (
      ${nullify(newSchoolName)}, 
      ${nullify(newRoom)}, 
      ${nullify(newPhone)}, 
      ${nullify(newHomepage)}, 
      ${nullify(newNotes)}, 
      ${nullify(newWifi)}, 
      ${nullify(newPhotocopier)}
      );
      `;

      try {
        // Run these statements using sql.js
        db.run(insertSchool);
        console.log("School successfully.");
      } catch (e) {
        console.log("Failed to insert school " + e);
        return false;
      }

      let newSchoolId;
      try {
        newSchoolId = db.exec(`SELECT last_insert_rowid();`)[0].values[0][0];
        console.log("Successfully fetched new school id: " + newSchoolId);
      } catch (e) {
        console.log("Failed to fetch new school id: " + e);
        return false;
      }

      const insertHod = `
      INSERT INTO hods_${actualYear} (
      school_id,
      first_name,
      last_name,
      mobile,
      phone,
      email
      )
      VALUES (
        ${nullify(newSchoolId)}, 
        ${nullify(newHodFirst)}, 
        ${nullify(newHodLast)}, 
        ${nullify(newHodMobile)}, 
        ${nullify(newHodPhone)}, 
        ${nullify(newHodEmail)}
      );
      `;
      try {
        db.exec(insertHod);
        console.log("Successfully inserted new HOD");
      } catch (e) {
        console.log("Failed to insert new HOD");
        return false;
      }

      // save updated database to localStorage
      // Export the database to a Uint8Array
      const uint8Array = db.export();
      console.log("Binary array:", uint8Array);
      // convert to base64 string to upload to db
      const base64String = uint8ArrayToBase64(uint8Array);
      console.log("base64string:", base64String);
      localStorage.setItem("dbBase64String", base64String);
      console.log("db with updated data added saved to localStorage");

      // reload page to rerender table
      location.reload();
    }
    $("#save-new-school").click(function () {
      saveNewSchool();
    });
